def hcf(a, b):
    if(b == 0):
        return abs(a)
    else:
        return hcf(b, a % b)



def simplify(x, y):
    hcfno = hcf(x, y)
    x = int(x / hcfno)
    y = int(y / hcfno)
    return (x, y)


